import React from 'react'

class GalleryItem extends React.Component {
    constructor(props) {
        super(props);
    }
    componentDidMount() {
        console.log(this.state.element)
        this.state = {
            element: this.props.element
        }
    }
    render() {
        return (
            this.props.element
        )
    }
}

export default GalleryItem;
